import React from 'react';
import {
  Table, TableBody, TableCell, TableContainer, TableHead,
  TableRow, Paper, Typography, Box
} from '@mui/material';

const FormComponentHMC = ({ title, studentInfo, subjectsData }) => {
  const { rollNumber, name, soName, date } = studentInfo || {};

  // Format date if it exists
  const formattedDate = date ? new Date(date).toLocaleDateString() : '-';

  return (
    <Box p={3} maxWidth={1200} mx="auto">
      <Typography variant="h5" align="center" gutterBottom>
        {title}
      </Typography>

      {/* Student Info Display */}
      <Box mt={3}>
        <Typography><strong>Roll Number:</strong> {rollNumber || '-'}</Typography>
        <Typography><strong>Name:</strong> {name || '-'}</Typography>
        <Typography><strong>S/o or D/o:</strong> {soName || '-'}</Typography>
        <Typography><strong>Date:</strong> {formattedDate}</Typography>
      </Box>

      {/* Subjects Table */}
      <TableContainer component={Paper} sx={{ mt: 3, overflowX: 'auto' }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#dddddd' }}>
              <TableCell sx={{ fontWeight: 'bold'}} rowSpan={2}>PAPER </TableCell>
              <TableCell sx={{ fontWeight: 'bold'}} text align='center' rowSpan={2}>S</TableCell>
              <TableCell sx={{ fontWeight: 'bold'}} text align='center' colSpan={2}>THEORY</TableCell>
              <TableCell sx={{ fontWeight: 'bold'}} text align='center' colSpan={2}>INTERNAL</TableCell>
              <TableCell sx={{ fontWeight: 'bold'}} text align='center' colSpan={2}>TOTAL</TableCell>
              <TableCell sx={{ fontWeight: 'bold'}} rowSpan={2}>RESULT</TableCell>
            </TableRow>
            <TableRow sx={{ backgroundColor: '#dddddd' }}>
              <TableCell>Max Marks</TableCell>
              <TableCell>Secured</TableCell>
              <TableCell>Max Marks</TableCell>
              <TableCell>Secured</TableCell>
              <TableCell>Max Marks</TableCell>
              <TableCell>Secured</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjectsData?.length > 0 ? (
              subjectsData.map((subject, index) => (
                <TableRow key={subject.id || index}>
                  <TableCell>{index + 1}</TableCell>
                  <TableCell sx={{ whiteSpace: 'normal', wordBreak: 'break-word' }}>
                    {subject.subject || '-'}
                  </TableCell>
                  <TableCell>{subject.internalMax || 0}</TableCell>
                  <TableCell>{subject.internalSecured || 0}</TableCell>
                  <TableCell>{subject.theoryMax || 0}</TableCell>
                  <TableCell>{subject.theorySecured || 0}</TableCell>
                  <TableCell>{subject.practicalMax || 0}</TableCell>
                  <TableCell>{subject.practicalSecured || 0}</TableCell>
                  <TableCell>{subject.result || '-'}</TableCell>
                </TableRow>
              ))
            ) : (
              <TableRow>
                <TableCell colSpan={9} align="center">
                  No subjects data available
                </TableCell>
              </TableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default FormComponentHMC;
